import React from 'react'

const Header = () => {
    return (
        <>
           <div className="header">
               <img src="https://img.icons8.com/ios/500/google-keep.png" alt="logo" />
               <h3 className="header-name">Ritesh Keep App</h3>
           </div> 
        </>
    )
}

export default Header
